import React, {useState} from 'react';
import '../css/reporttable.css';
import { createAPIEndpoint, ENDPOINTS } from '../api/index.js';

function CustomerSearch(){
    const [data, setData]= useState([]);

    const blankFilters = {
        id: "",
        name: "",
        description: "",
        location: "",
        min_height: "",
        max_height: "",
        start_time: "",
        end_time: "",
        breakdown_nums: ""
    };

    const [filters, setFilters] = useState(blankFilters);
    const updateFilters = (obj) => {setFilters({...filters,...obj});}

    const findride = () => {
        createAPIEndpoint(ENDPOINTS.ride)
        .fetch()
        .then(response => {
            setData(response.data)})
        .catch(error => console.log(error))
    }

    const renderTable = () => {
        let info = data;
        if (filters.id != "") { 
            info = info.filter((item) => {
                return (item.attraction_id == filters.id);
            });
        }
        return info.map(elem => {
            return (
                <tr>
                    <td>{elem.attraction_id}</td>
                    <td>{elem.name}</td>
                    <td>{elem.description}</td>
                    <td>{elem.location}</td>
                    <td>{elem.min_height}</td>
                    <td>{elem.start_time}</td>
                    <td>{elem.end_time}</td>
                    <td>{elem.breakdown_nums}</td>
                </tr>
            );}
        )
    }

    return (
        <div className='searchbox'>
            <h2>Ride Search</h2>
            <div>
                <p>*You can search by exact matches or by ranges. Only search by one or the other.</p>
                <form name="ridesearch" id="ridesearch">
                    <table className="filter-table">
                        <tr>
                            <th>ID:</th>
                            <th>Name:</th>
                            <th>Description:</th>
                        </tr>
                        <tr>
                            <td><input type="text" name="customer_id" value={filters.id} onChange={(e) => updateFilters({id:e.target.value})}/></td>
                            <td><input type="text" name="fname" value={filters.fname} onChange={(e) => updateFilters({fname:e.target.value})}/></td>
                            <td><input type="text" name="lname" value={filters.lname} onChange={(e) => updateFilters({lname:e.target.value})}/></td>
                        </tr>
                    </table>
                </form>
            </div><br/>
            <button onClick={findride} className="submit-button" type="button">Search Rides</button>
            <br /><br />
            <br /><br />
            <table className="result-table">
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Name</th>
                        <th>Description</th>
                        <th>Location</th>
                        <th>Minimum Height</th>
                        <th>Start Time</th>
                        <th>End Time</th>
                        <th>Breakdowns</th>
                    </tr>
                </thead>
                <tbody>{renderTable()}</tbody>
            </table>
        </div>

    )

}

